import { MenuButton } from "../../styles/Menu";
import { SerifText, SerifTextS } from "../../styles/TextStyles";

export const MenuButtonY = () => {
  return (
    <MenuButton>
      <div style={{ flex: 1, backgroundColor: "pink" }}></div>
      <div style={{ flex: 4, backgroundColor: "yellow" }}>
        <SerifText>Cokolwiek</SerifText>
      </div>
    </MenuButton>
  );
};
